def a(): pass
if len(argv) == 2:
    icon = b''
    b = open(f"C:/Users/{getuser()}/AppData/Local/Temp/icon.ico", 'wb')
    b.write(b64decode(icon))
    b.close()
    win = Tk()
    win.iconbitmap(f"C:/Users/{getuser()}/AppData/Local/Temp/icon.ico")
    win.resizable(0, 0)
    win.protocol("WM_DELETE_WINDOW", a)
    scroll = ScrolledText(win, width=30, height=10, font="SegoeUI 10")
    scroll.insert(INSERT, argv[1])
    scroll.grid(column=0, row=1)
    if argv[1].endswith(".ins"):
        win.title("Extracting...")
        Label(win, text=f"Extracting...").grid(column=0, row=0)
        win.after(1000, lambda: extract64(argv[1], basename(argv[1]).split('/')[-1][:-4]))
